CREATE DEFINER=`id16521943_angel`@`%` FUNCTION `initcap` (`cadena` VARCHAR(100)) RETURNS VARCHAR(100) CHARSET utf8 COLLATE utf8_unicode_ci BEGIN 
        DECLARE pos INT DEFAULT 0; 
        DECLARE tmp VARCHAR(100) 
        DEFAULT ''; 
        DECLARE result VARCHAR(100) DEFAULT ''; 
        REPEAT SET pos = LOCATE(' ', cadena); 
        IF pos = 0 THEN 
            SET pos = CHAR_LENGTH(cadena); 
        END IF; 
        SET tmp = LEFT(cadena,pos); 
        IF CHAR_LENGTH(tmp) < 4 THEN
            SET result = CONCAT(result, tmp); 
        ELSE 
            SET result = CONCAT(result, UPPER(LEFT(tmp,1)),SUBSTR(tmp,2)); 
        END IF; 
        SET cadena = RIGHT(cadena,CHAR_LENGTH(cadena)-pos); 
        UNTIL CHAR_LENGTH(cadena) = 0 END REPEAT; 
        RETURN result; 
    END$$

