INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(7, 'El exilio del alma', 'Cafe', '4', 104, 'El libro presenta la última obra del filósofo José Ignacio Eguizába.', 'Nuevo', 200, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(8, 'Una mirada perdida', 'Cafe', '4', 178, 'La desaparición de un niño chino pone en marcha una investigación a cargo de un grupo variopinto de personajes, a cada cual más estrafalario, quienes se adentran en el mundo que se esconde tras la comunidad chin. ', 'Nuevo', 100, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(9, 'Churras y Merinas (Visiones)', 'Cafe', '4', 398, 'Reflexiones que fueron apareciendo a lo largo de seis años en columnas semanales del periódico \"La Gaceta Regional de Salamanca\" con el título genérico de “Churras y merinas”.', 'Nuevo', 200, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(11, 'La decision de Julia', 'Gris', '5', 248, 'Narra la crisis de una mujer cuando irrumpe en su vida, sin previo aviso, un amor de adolescencia. El azar le ofrece revivir la pasión que representa la última oportunidad de resurgir, antes de adentrarse en la vejez.', 'Nuevo', 300, , 55, 19);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(13, 'El cazador de lobos', 'Gris', '5', 252, 'En un mundo asolado por la pandemia, sin normas, en el que el respeto, la bondad o los sentimientos son debilidades inasumibles, la única ley es la que impone el más fuerte, y la fuerza la ejercen los lobos.', 'Nuevo', 250, , 56, 18);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(14, 'Ramón y Cajal.', 'Gris', '5', 212, 'En 2016, el palacete junto a los jardines madrileños de El Retiro donde vivió, investigó y murió el Premio Nobel de medicina D. Santiago Ramón y Cajal, fue vendido para ser transformado en pisos de lujo. ', 'Nuevo', 120, , 57, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(15, 'Cuentos irresponsables', 'Gris', '5', 156, 'Este libro puede parecer que va de animales, pero también va de otras cosas muy cercanas a nuestra propia naturaleza.', 'Nuevo', 100, , 58, 13);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(16, 'El legado de los malditos', 'Gris', '5', 156, 'Este libro puede parecer que va de animales, pero también va de otras cosas muy cercanas a nuestra propia naturaleza.', 'Nuevo', 100, , 59, 12);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(18, 'La mujer del otro', 'Gris', '5', 208, 'Editorial Amarante presenta la última obra del escritor almeriense José Navarro quien vuelve a sorprendernos con su impagable caleidoscopio de personajes y narraciones memorialísticas. En esta ocasión \"La mujer del otro\" se convierte en la novela.', 'Nuevo', 250, , 61, 21);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(19, 'Darwinismo ', 'Verde', '9', 240, 'Último ensayo de Enrique Martínez Miura.', 'Usado', 100, , 100, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(20, 'Blue paradise', 'Azul', '2', 100, 'Si ha sido capaz de remontar su trayectoria lineal hacia atrás ¿acaso no podría hacer lo propio hacia delante?” Le dice la jovencísima cantante Eva al errante viajero Adam Taylor en el “Blue Paradise”.', 'Nuevo', 100, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(22, 'La musica en las catedrales', 'Amarillo', '1', 600, 'Se trata de una actualización de un libro de 1961, ampliado con numerosísimas notas por parte del autor y traducido al español Se divide en tres partes, dedicada cada una respectivamente a Morales, Guerrero y Victoria. ', 'Nuevo', 200, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(23, 'Conatus', 'Gris', '5', 66, 'El libro, en el que dialogan pequeños textos e imágenes (presentadas en orden invertido), es parte de un proceso en el que la vida, algunos conceptos y la fotografía han generado una complicidad.', 'Nuevo', 100, , 62, 13);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(24, 'Versos y coplas', 'Rosa', '9', 114, 'La antología de canciones del compositor y escritor José Navarro Ballesteros, \"Versos y coplas\".', 'Usado', 100, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(25, 'SUB SUA', 'Gris', '5', 340, 'Un desafío vertiginoso de dolor y sangre en un Londres oscuro y frío. Una novela negra sugerente donde el ajedrez juega un papel especial.', 'Nuevo', 190, , 63, 15);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(27, 'Nosotros, los buenos', 'Gris', '5', 320, 'El protagonismo de la mujer\" en la obra de Iván Robledo. Sus dos últimas novelas, \"Cira Leyton\" y \"Nosotros los buenos\" en un solo volumen.', 'Nuevo', 190, , 20, 7);
