(33, 'Diario a bordo (2ª Edición)', 'Gris', '5', 392, 'El naufragio de un pequeño yate, que queda varado, deja al descubierto un escenario macabro y demasiadas preguntas sin respuesta. ', 'Nuevo', 199, , 65, 13);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(34, 'dinosaurio en la bañera', 'Amarillo', '1', 104, 'Es la lucha diaria de una joven contra los elementos que la rodean para poder salir adelante y ser independiente.', 'Nuevo', 150, , 80, 6),
(35, 'Trazos', 'Amarillo', '1', 94, 'Último libro de Antonio Colinas y Mónica Velasco.', 'Usado', 100, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(36, 'Sábado Inglés', 'Rojo', '8', 350, 'Última novela de Jorge L. Penabade.', 'Usado', 100, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(37, 'La vida prometida', 'Gris', '5', 184, 'En \"Ciudadanía\", un diminuto pueblo de Estados Unidos, un hombre de 45 años llamado Job se hace pasar por vidente.', 'Usado', 100, , 65, 10);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(38, 'La duda de Edward de Bry', 'Azul', '2', 354, 'La curiosidad y el exceso de celo de Philip Nash, físico y vicepresidente ejecutivo de la opulenta Fundación de Bry, lo empujan a iniciar una investigación que sacará a la luz oscuros secretos y le hará temer por su propia vida.', 'Nuevo', 200, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(39, 'El espía cordial', 'Gris', '5', 76, '\"El espía cordial\" un libro que contiene dieciséis relatos humorísticos que aúnan la fina percepción de las contradicciones y paradojas de la realidad cotidiana con una mirada hondamente compasiva sobre las debilidades de la naturaleza humana.', 'Usado', 100, , 66, 20);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(40, 'Las cenizas de Manhattan', 'Gris', '5', 358, 'Última novela de Pedro López Fernández.', 'Nuevo', 190, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(41, 'Media Training', 'Rojo', '8', 212, 'Guía teórica y práctica para hablar con éxito frente a una cámara de vídeo.', 'Usado', 100, , 95, 14);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(42, 'El libro del azafrán', 'Morado', '6', 184, 'La presente obra, estamos seguros, ayudará al lector a acercarse un poco más a los encantos y misterios de esta planta, convirtiéndose, por otra parte, en una interesante y amena guía para descubrir nuevos placeres culinarios y reposteros.', 'Nuevo', 100, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(43, 'Llumantia Ilíquida', 'Rojo', '8', 80, 'Última obra poética de la escritora y profesora salmantina Mónica Velasco.', 'Usado', 100, , 94, 13),
(44, 'De andar por casa', 'Azul', '2', 138, 'Reflexiones y sentimientos de una escritora, vertidos en las páginas de este libro durante el periodo de confinamiento por la crisis del Covid-19.', 'Nuevo', 150, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(45, 'Croata', 'Azul', '2', 374, 'El presente ensayo histórico es una aproximación a la historia de un barrio de clase trabajadora, ubicado en Salamanca: \"Los Pizarrales\", a través del estudio de tres generaciones, desde que este comenzase a ser poblado a principios del siglo XX.', 'Nuevo', 300, , 18, 19),
(46, 'Una historia en La Habana', 'Rojo', '8', 246, 'Son los oscuros recodos de la mente, los detalles que mellan un alma hasta convertirla en asesina.', 'Nuevo', 190, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(47, 'La polifonia clasica', 'Naranja', '6', 216, ' Se hace un estudio muy completo de la musica ficta subintelecta. Sin embargo, dado que es bastante antiguo, no refleja los criterios musicológicos actuales. La segunda parte es una pequeña introducción a las formas musicales de la época.', 'Nuevo', 150, , 69, 6),
(48, 'Espacios olvidados', 'Azul', '2', 220, 'Finalista del Premio Azorín de novela 2019. Fabio Milhanas, comandante del ejército portugués y futuro diplomático en España, contempla atónito el crimen de un compañero de armas a manos de un mendigo.', 'Nuevo', 300, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(49, 'Bestiarum Curriculum', 'Naranja', '6', 122, 'Ensayo crítico sobre el método científico.', 'Nuevo', 179, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(51, '¿Dónde están los poetas?', 'Azul', '2', 186, 'Los delitos de asesinato prescriben en España a los veinte años, y a Rubén Lourido le quedaba tan solo una semana para que se cumpliera ese plazo.', 'Nuevo', 180, , 20, 18);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(52, '¿CÓMO PIERDO PESO?', 'Azul', '2', 114, '\"Cómo pierdo peso? Tengo una aminoacidopatía\", el último libro de la nutróloga Aline Leonardo, autora entre otras obras de: \"Gluten, el monstruo de las galletas\" y \"Desayunos y meriendas sin gluten, sin huevo y sin leche\".', 'Nuevo', 210, , 21, 21);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(53, 'La llave de los días', 'Naranja', '6', 156, 'Último libro de relatos de Elena Fernández Yárritu.', 'Nuevo', 160, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(54, 'Banderas dobladas', 'Naranja', '6', 100, 'Libro de relatos de Ignacio Fernández Perandones. ', 'Nuevo', 150, , 73, 13);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(55, 'Frankestein', 'Negro', '7', 304, 'Frankenstein es una historia macabra en la que Víctor, un joven ávido de conocimientos científicos, se obsesiona por lograr el mayor reto posible en el mundo científico: dar vida a un cuerpo muerto.', 'Nuevo', 157, , 74, 7),
(57, 'Ultimos dias de Sara', 'Negro', '7', 528, ' Laura Bosch está sufriendo un sutil pero constante acoso por parte de desconocidos cuando pide ayuda a su amiga Berta, que es detective. Laura tiene dos hijos ya independizados y vive sola en una casa aislada.', 'Nuevo', 350, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(58, 'Vuelos rasantes', 'Azul', '2', 176, '\"Vuelos rasantes\" es un libro de relatos donde los protagonistas a duras penas logran levantar el vuelo de sus atribuladas vidas.', 'Nuevo', 180, , 80, 6),
(59, 'El silencio de la lengua', 'Rojo', '8', 108, 'Transitar por los angostos espacios de la poesía, es como mirar al abismo donde el caminante puede despeñar su realidad, urgir el abandono y hundirse, siempre con dolor, en lo más profundo del ser. ', 'Nuevo', 210, , 92, 14);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(60, 'Derecho administrativo mínimo', 'Rojo', '8', 788, 'Compendio del conocimiento jurídico general de la organización y funcionamiento del poder público, que sería el mínimo que debería dominarse al graduarse en derecho.', 'Nuevo', 680, , 91, 16),
(61, 'EL sueño del alfarero', 'Negro', '7', 253, 'Un cadáver desnudo y cruelmente torturado aparece en el fondo de la piscina vacía de un polideportivo abandonado en Cumbres de Calicanto. No hay denuncias de desaparecidos, ni nadie que reclame el cuerpo.', 'Nuevo', 200, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(62, 'Las horas', 'Azul', '2', 24, 'Libro infantil para aprender y jugar con los números y las horas.', 'Nuevo', 699, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(63, 'Pico, Brillo y el anillo', 'Azul', '2', 244, '\"Pico, Brillo y el anillo\". Un libro infantil para niños de 4 a 8 años.', 'Usado', 100, , 94, 15);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(64, 'El asesino de blood', 'Negro', '7', 276, 'La inspectora Asunción Romero y la subinspectora Ingrid Canseco están al frente de la investigación de una serie de crímenes que han sido perpetrados en lugares de ocio. Un cine, un “escape room” y una cancha de tenis durante la semana.', 'Nuevo', 200, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(65, 'Gabinete de curiosidades', 'Rojo', '8', 328, 'Los \"Gabinetes de curiosidades\", o \"Cuartos de maravillas\", son los precedentes inmediatos de los museos modernos; lugares donde las colecciones privadas se exponían como alardes de ciencia y de superstición.', 'Nuevo', 400, , 90, 18);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(66, 'El shamán urbano', 'Azul', '2', 354, 'Última novela de Manuel Lara Herbón.', 'Nuevo', 189, , 80, 6),
(67, 'Las mujeres del César', 'Negro', '7', 166, 'Un siglo de burguesía española o el siglo de una familia o el siglo de la barbarie... desde la voz del protagonista escuchamos los latidos amargos de una clase social que con su país nunca adquirió el compromiso suficiente para ser respetada.', 'Nuevo', 200, , 80, 6);
INSERT INTO `Libro` (`id_libro`, `nombre`, `color`, `estante`, `numero_paginas`, `descripcion`, `estado`, `precio`, `imagen`, `id_autor`, `id_editorial`) VALUES
(68, 'Salmos de vísperas', 'Rojo', '8', 135, 'El libro contiene una interesante introducción con la historia del manuscrito y una estupenda transcripción siguiendo todos los convenios de la musicología actual. ', 'Nuevo', 250, , 89, 11),
(69, 'Re-evoluciona tu mente', 'Azul', '2', 236, 'Cuando tenemos una meta y un camino claro que nos orienta, ocurre algo maravilloso: todo adquiere sentido.', 'Usado', 100, , 80, 6);
