(70, 'Telaraña de odio', 'Blanco', '3', 334, 'La tarde del 1 de marzo de 1940 desaparecía en Tallahassee, capital del Estado de Florida, la joven universitaria Caroline Short sin dejar ningún rastro.', 'Nuevo', 199, , 80, 6);
