(72, 'Cenizas e incendios', 'Blanco', '3', 114, 'Primera obra ilustrada de Sara Carballal.', 'Nuevo', 130, , 80, 6),
(74, 'El derecho de la nutrición', 'Blanco', '3', 252, 'Ensayo jurídico y sociológico sobre la nutrición. Libro de consulta.', 'Usado', 100, , 80, 6);
