(77, 'Las zonas frías del Sol', 'Blanco', '3', 228, 'La acción transcurre en una Barcelona casi real. En el ficticio hotel Manila, el jefe de botones, Andrés, motejado como el Ratón, facilita que algunos puedan fisgar la vida privada de los huéspedes.', 'Nuevo', 199, , 46, 15);
