(81, 'Memorias de un homicida', 'Blanco', '3', 258, 'El narrador de \"Memorias de un homicida\", es un anciano que rememora sus años de infancia y adolescencia, sus experiencias traumáticas en la escuela y en un internado de religiosos, sus reacciones violentas.', 'Usado', 100, , 80, 6),
