(112, 'El corazón de la piedra', 'Amarillo', '1', 506, 'Una novela ambientada en la Europa de los siglos XVI y XVII y que tiene a Tomás Luis de Victoria como uno de sus protagonistas.', 'Nuevo', 389, , 80, 6),
(113, 'Inconscientia', 'Azul', '2', 354, 'A Vera le atormentan unas pesadillas que parecen querer revelar algo sobre su confusa existencia. Ella siente que sus padres se la juegan constantemente, y la única persona en quien confía es su abuela, que lamentablemente tiene Alzheimer.', 'Nuevo', 200, , 80, 6);
