-- Disparadores `Libro`
--
DELIMITER $$
CREATE TRIGGER `delect_libro` AFTER DELETE ON `Libro` FOR EACH ROW DELETE FROM Inventario 
        WHERE id_libro = OLD.id_libro
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `insert_libro` AFTER INSERT ON `Libro` FOR EACH ROW INSERT INTO Inventario(id_libro, stock_libros, fechadeingreso) 
        VALUES(NEW.id_libro, 0, SYSDATE())
$$
DELIMITER ;

